import React from 'react';
import PostForm from "./components/PostForm";
import Post from "./components/Post";
import Posts from "./components/Posts";

function App() {
  return (
    <div className="container pt-3">
        <div className="row">
            <div className="col">
                <PostForm/>
            </div>
        </div>
        <div className="row">
            <div className="col">
                <Post/>
            </div>
            <div className="col">
                <Posts/>
            </div>
        </div>
    </div>
  );
}

export default App;
